import Todo from './Todo';

const todos = [
    {id: 1, message: 'Walk the dog'},
    {id: 2, message: 'Cook dinner'},
    {id: 3, message: 'Do your laundry'}
]

function TodoList(){
    return (
        <div>
            {todos.map(todo => {
                return <Todo key = {todo.id} todo={todo}/>
            })}
        </div>
    )
};

export default TodoList;
